	unsigned long long perft(libChess::Position& pos, unsigned int depth)
	{
	/*
		if (depth == 0) {
			return 1;
		}
	*/
		unsigned long long tot = 0;
		libChess::MoveList< libChess::MoveGenerator::maxMovePerPosition > ml;
		libChess::MoveGenerator::generateMoves< libChess::MoveGenerator::allMg >( pos, ml );
		if (depth == 1) {
			
			return ml.size();
		}
		
		for( auto& m: ml )
		{
			pos.doMove(m);
			tot += perft( pos, depth - 1);
			pos.undoMove();
		}
		return tot;

	}
	
	TEST(MoveGenerator,perft)
	{
		
		Position pos;
		
		for (auto & p : perftPos)
		{
			std::cout<<p.Fen<<std::endl;
			pos.setupFromFen( p.Fen ); 
			for( unsigned int i = 0; i < p.PerftValue.size(); i++)
			{
				unsigned long long int res = perft( pos, i+1);
				std::cout<<i+1<<" "<<res<<std::endl;
				EXPECT_EQ( p.PerftValue[i], res);
			}
		}
	}
	
